import (
	context "context"
	fern "github.com/enum/fern"
	fernclient "github.com/enum/fern/client"
)

client := fernclient.NewClient()
err := client.InlinedRequest.Send(
	context.TODO(),
	&fern.SendEnumInlinedRequest{
		Operand: fern.Operand,
	},
)

